import React from 'react';

import './App.css';

class App extends React.Component{

  call(){

    fetch("http://localhost:5000/data")
        .then(res => res.text())
        .then(res => console.log(res));

  }


  render(){
    return (
      <div>
        <button onClick={this.call}>submit</button>
      </div>
    )
  }
}
export default App;
